import React from 'react';
import './App.css';
import Mainrouter from './router/mainrouter';
import Api from './services/sevices';

function componentDidMount() {
  Api.get('option')
  .then(res => {
    const optios = res.data['data'];
    console.log(optios[0].name_web);
    sessionStorage.setItem('nameweb',optios.name_web);
  })
}


function App() {
  componentDidMount();
  return (
    <Mainrouter />
  );
}

export default App;
